pub fn get_vendor(id: u16) -> Option<&'static Vendor> {
    VENDORS.iter().find(|v| v.id == id)
}
pub fn get_class(id: u8) -> Option<&'static BaseClass> {
    CLASSES.iter().find(|c| c.id == id)
}
pub struct Vendor {
    id: u16,
    name: &'static str,
    devices: Vec<Device>,
}
impl Vendor {
    pub fn id(&self) -> u16 {
        self.id
    }
    pub fn name(&self) -> &'static str {
        self.name
    }
    pub fn get_device(&self, id: u16) -> Option<&Device> {
        self.devices.iter().find(|d| d.id == id)
    }
}
pub struct Device {
    id: u16,
    name: &'static str,
    subsystems: Vec<SubSystem>,
}
impl Device {
    pub fn id(&self) -> u16 {
        self.id
    }
    pub fn name(&self) -> &'static str {
        self.name
    }
    pub fn get_subsystem(&self, vendor: u16, device: u16) -> Option<&SubSystem> {
        self.subsystems
            .iter()
            .find(|s| s.sub_vendor == vendor && s.sub_device == device)
    }
}
pub struct SubSystem {
    sub_vendor: u16,
    sub_device: u16,
    name: &'static str,
}
impl SubSystem {
    pub fn sub_vendor(&self) -> u16 {
        self.sub_vendor
    }
    pub fn sub_device(&self) -> u16 {
        self.sub_device
    }
    pub fn name(&self) -> &'static str {
        self.name
    }
}
pub struct BaseClass {
    id: u8,
    name: &'static str,
    sub_classes: Vec<SubClass>,
}
impl BaseClass {
    pub fn id(&self) -> u8 {
        self.id
    }
    pub fn name(&self) -> &'static str {
        self.name
    }
    pub fn get_sub_class(&self, id: u8) -> Option<&SubClass> {
        self.sub_classes.iter().find(|c| c.id == id)
    }
}
pub struct SubClass {
    id: u8,
    name: &'static str,
    prog_ifs: Vec<ProgIf>,
}
impl SubClass {
    pub fn id(&self) -> u8 {
        self.id
    }
    pub fn name(&self) -> &'static str {
        self.name
    }
    pub fn get_prog_if(&self, id: u8) -> Option<&ProgIf> {
        self.prog_ifs.iter().find(|c| c.id == id)
    }
}
pub struct ProgIf {
    id: u8,
    name: &'static str,
}
impl ProgIf {
    pub fn id(&self) -> u8 {
        self.id
    }
    pub fn name(&self) -> &'static str {
        self.name
    }
}
